INSERT INTO `lang_definitions` VALUES (8113, 2976, 4, 'Bij het klikken op een invoice nummer verschijnt het \"handleiding posting venster\". Hier kunt u de datum en notities voor de factuur veranderen, de naam selecteren voor wie je invoert en de verzekeringen selecteren waarvoor alle te verwachen betalingen zijn ontvangen. Belangrijker, voor elke facturerings code waarvoor een bedrag in rekening werd gebracht, kunt u de betaling en informatie aanpassen.');
INSERT INTO `lang_definitions` VALUES (8114, 2977, 4, 'Bij het zoeken wordt u een lijst van facturen getoond. U klikt op een van de factuurnummers om een tweede venster te openen, waarbij gegevensinvoer in de pagina handmatig gedaan kan worden. U kunt ook klikken op de naam van een patint als u een notitie wilt maken voor de front office medewerkers, zodat deze kunnen zien wanneer de patint aankomt en u kunt de facturen selecteren die op de statements van de patint verschijnen en deze statements afdrukken.');
